⠀
Давайте посмотрим, какие мнения есть на этот счет.
⠀
Если вы хотите приобрести квартиру для проживания, то сейчас самая низкая в истории России ставка по ипотеке – 6,5%. Помните, что распространяется она только на жилье от застройщика и действовать будет строго до конца октября 2020 года. Продлевать льготную ипотечную программу правительство не намерено. По крайней мере, в экспертном сообществе таких слухов нет.
⠀
С начала года наблюдается постоянный рост стоимости недвижимости на рынке первичного и вторичного жилья. И оснований считать, что к концу года эта тенденция изменится, пока нет. В мае и июне рост стоимости жилья ежемесячно составлял около 3%, что весьма ощутимо.
⠀
Покупать или продавать квартиру нужно тогда, когда это нужно, а не смотреть в прогнозы и предположения. Гадать на кофейной гуще – неблагодарное занятие. Лучше жить в реальной картинке, чем загадывать на перспективу. Можно и не выгадать.
⠀
До сих пор не понятно, как будет развиваться ситуация с пандемией, а это означает, что мы до конца не знаем, откроют ли границы, начнут ли люди вновь активно путешествовать. Пока они этого не делают, у многих есть желание вложить не потраченные средства в недвижимость.
⠀
Скорее всего, основной скачок спроса произойдет накануне окончания срока действия льготной ипотеки. Многие будут пытаться успеть «в последний вагон».
⠀
